import React from "react";
import { Form } from "react-router-dom";

export const ContactForm = ({
  name,
  setName,
  phone,
  setPhone,
  email,
  setEmail,
  handleSubmit
}) => {
  return (
    <>
    <form onSubmit={handleSubmit}>
      <label for='nam'> Enter your name: </label>
      <input
      name="name"
      value={name}
      onChange={(e)=>setName(e.target.value)}
      
      type="text"
      />
    </form>
    </>
  );
};
